import React from "react";
import "./ContactUs.css";

console.clear();

var inputs = Array.from(document.querySelectorAll("input"));
inputs.forEach((input) => {
  window.setInterval(function () {
    if (input.value == "") {
      input.classList.remove("hasvalue");
    } else {
      input.classList.add("hasvalue");
    }
  }, 10);
});

export default function ContactUs() {
  return (
    <div>
      <div className="app">
        <form className="form">
          <h1 className="app-info">Contact Us</h1>
          <div className="user_field">
            <div className="row _1" style={{ index: 0 }}>
              <div className="textfield">
                <input type="text" className="text-input" />
                <span className="fieldinfo">Name</span>
              </div>
              <div className="textfield">
                <input type="email" className="text-input" />
                <span className="fieldinfo">Email</span>
              </div>
            </div>
            <div className="row _2" style={{ index: 1 }}>
              <div className="textfield">
                <input type="number" className="text-input" />
                <span className="fieldinfo">Phone</span>
              </div>
              <div className="textfield">
                <input type="text" className="text-input" />
                <span className="fieldinfo">Contact Hours</span>
              </div>
            </div>
            <div className="row _3" style={{ index: 2 }}>
              <div className="textfield">
                <textarea
                  className="text-input"
                  placeholder="Type your message here."
                  defaultValue={""}
                />
              </div>
            </div>
            <div className="row _4" style={{ index: 3 }}>
              <button className="submit btn">Submit</button>
            </div>
          </div>
        </form>
      </div>
    </div>
  );
}
